import React from "react";

export default function Home() {
  return (
    <section id="home" className="bg-opacity-100 bg-gradient-to-b from-twilight-900 via-twilight-900">
      <div className="container mx-auto flex flex-col items-center py-20">
        <h1 className="text-3xl text-white mb-4">Welcome to my Portfolio Site!</h1>
        <h2 className="text-xl text-blue-200 mb-4">This is the homepage</h2>
      </div>
    </section>
  );
}
